import React from "react";
import Navigations from "./Navigations";
import {Head, Body} from "next";

export default function Layout({ children, title }) {
 return (
  <div>
   <Head>
    <title>{title}</title>
   </Head>
   <Body>
      <Navigations />
      <main>{children}</main>
   </Body>
  </div>
 );
}
